import React, { useEffect, useState } from 'react';
import { EditPaciente } from '../components/EditPaciente';


export const ListPatients = () => {
  // const { pacientes, setPacientes } = props;

  const [pacientes, setPacientes] = useState([]);
  //const [showEditForm, setShowEditForm] = useState(false);
  const [editedPaciente, setEditedPaciente] = useState(null);


  useEffect(() => {
    async function getPacientes() {
      const res = await fetch("/api/pacientes");
      const pacientes = await res.json();
      setPacientes(pacientes);
    }
    getPacientes();
  }, []);

  const deletePaciente = async (pacienteId) => {
    const res = await fetch(`/api/pacientes/${pacienteId}`, {
      method: "DELETE"
    });
    const json = await res.json();
    if (json.acknowledged) {
      setPacientes(currentPacientes => {
        return currentPacientes.filter((currentPaciente) => currentPaciente._id !== pacienteId);
      });
    }
  };

  const handleEditClick = (paciente) => {
    setEditedPaciente(paciente);
  };

  const handleCloseEdit = () => {
    setEditedPaciente(null); // Restablecer editedPaciente a null para ocultar el componente EditPaciente
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
        // Tu código para guardar cambios en la base de datos

        // Después de guardar los cambios, recargar la lista de pacientes
        await getPacientes();
        onClose(); // Cierra el formulario después de guardar los cambios
    } catch (error) {
        console.error('Error al guardar cambios:', error);
        // Manejo de errores
    }
};

  return (
    <div>
      {editedPaciente ? (
        <EditPaciente paciente={editedPaciente} onClose={handleCloseEdit} />
      ) : (
        <div>
          {pacientes && pacientes.length > 0 ? (
            pacientes.map(p => (

              <article key={p._id} className="patient-item">
                <p className="active">Estado activo:{p.active}</p>
                <p className="name">Nombre:{p.name}</p>
                <p className="gender">Género:{p.gender}</p>
                <p className="birthDate">Fecha de nacimiento:{p.birthDate}</p>
                <div>
                  <button className="edit" onClick={() => handleEditClick(p)}>Editar</button>
                  <button className="delete" onClick={() => deletePaciente(p._id)}>Borrar</button>
                </div>
              </article>
          ))
        

        ) : (

          <h2>No hay pacientes para mostrar</h2>
        )}

        </div>
      )}
    </div>
  );
};
export default ListPatients;
